function Hero() {
  return (
    <section id="hero" className="bg-cover bg-center h-screen text-white flex items-center justify-center" style={{ backgroundImage: "url('/assets/hero.jpg')" }}>
      <div className="bg-black bg-opacity-50 p-10 rounded">
        <h1 className="text-4xl font-bold mb-4">Plan Your Dream Wedding</h1>
        <p className="text-lg">With ShaadiClone - Your Celebration Partner</p>
      </div>
    </section>
  );
}

export default Hero;
